export default function CreatePost() {
  return (
    <div>
        <h1>Create Post</h1>
        <form>
            <input type="title" placeholder={'title'}/>
            <input type="summary" placeholder={'summary'}/>
            <input type="file"/>
            <ReactQuill/>

        </form>
    </div>
  );
}
